import axios from "axios";

const getCripto = async () => {
    try {
        const response = await axios.get('https://api.coincap.io/v2/assets', {
            params: {
                limit: 5,
                offset: 5,
            }
        });
        return response.data;
    } catch (e) {
        console.log(e);
        return [];
    }

};

export default getCripto;
